class Competition(object):
  def __init__(self, competition_id, state, start_date, end_date, name, events):
    self.competition_id = competition_id
    self.state = state
    self.region = state_to_region[state]
    self.start_date = start_date
    self.end_date = end_date
    self.name = name
    self.events = events
    
  def StartDate(self):
    return '%s %d' % (self.start_date.strftime('%b'), self.start_date.day)

  def EndDate(self):
    if self.start_date.month == self.end_date.month:
      return self.end_date.day
    return '%s %d' % (self.end_date.strftime('%b'), self.end_date.day)

  def IsMultiDays(self):
    return self.start_date != self.end_date

